<!doctype html><html tabindex="-1"><head tabindex="-1"><meta http-equiv="X-UA-Compatible" content="IE=edge"/><meta charset="utf-8"/><meta name="viewport" content="width=device-width"/><style>html {
                overflow: hidden !important;
                height: 100%;
                -ms-content-zooming: none;
                touch-action: none;
            }

            body {
                
                    background-color: rgba(230,230,230,1.00);
                
                margin: 0px;
                height: 100%;
                overflow: hidden !important;
            }

            #main {
                display: inline;
                position: fixed;
                top: 0px;
            }</style><style>div#LoadingModal {
            position: absolute;
            z-index: 501;
            width: 100%;
            height: 100%;
            padding-top: 94px;
            transition: opacity 0.5s cubic-bezier(0.22, 0.61, 0.36, 1);
            opacity: 1;
            background-color: inherit;
            }

            div#ErrorIcon, div#BlackErrorIcon, div#WhiteErrorIcon {
            display: none;
            z-index: 501;
            width: 100%;
            height: 100%;
            transition: opacity 0.5s cubic-bezier(0.22, 0.61, 0.36, 1);
            opacity: 1;
            background-color: inherit;
            }

            div#LoadingModal * {
            vertical-align: middle;
            }

            div#LoadingModal > div {
            height: 40px;
            width: 165px;
            margin: 0 auto 5px auto;
            text-align: center;
            font-size: small;
            font-family: Segoe UI;
            }

            div#ErrorContainer {
            display: none;
            width: 100%;
            margin: 0 auto 5px auto;
            text-align: center;
            padding-top: 95px;
            font-size: small;
            font-family: Segoe UI;
            }

            #ErrorMessage {
            margin: 12px;
            }

            div#LoadingModal svg {
            width: 25%;
            margin-bottom: 8px;
            animation: 2s linear infinite svg-animation;
            }

            div#ErrorIcon img, div#ErrorIcon svg, div#BlackErrorIcon svg, div#WhiteErrorIcon svg {
            width: 160px;
            height: 160px;
            margin-bottom: 24px;
            }

            div {
                outline: 0
            }

            .reportButton  {
                color: #123078;
                text-decoration: underline;
                font-size: 12px;
                cursor: pointer;
                margin-top: 4px;
            }

            .openFindReplaceButton {
                margin-top: 24px;
                border: 1px solid #d1d1d1;
                background: white;
                border-radius: 4px;
                padding: 4px 8px;
                position: absolute;
                left: 50%;
                transform: translate(-50%);
                cursor: pointer;
            }

            .staticSearchBoxContainer {
                position: relative;
                z-index: 100;
                display: flex;
                border: 1px solid rgb(200, 198, 196);
                background-color: white;
                border-radius: 4px;
                outline: none;
                overflow: hidden;
                
                    margin: 0px 4px 0px 4px;
                
                
                transition: opacity 0.5s cubic-bezier(0.22, 0.61, 0.36, 1);
            }

            #StaticSearchbox {
                width: calc(100% - 12px);
                margin-left: 5px;
                border: none;
                outline: none;
                
                
                padding: 8px 0px 8px 8px;
            }

            @keyframes svg-animation {
              0% {
                transform: rotateZ(0deg);
              }
              100% {
                transform: rotateZ(360deg)
              }
            }

            circle {
              animation: 1.4s ease-in-out infinite both circle-animation;
              display: block;
              fill: transparent;
              stroke: #2f3d4c;
              stroke-linecap: round;
              stroke-dasharray: 283;
              stroke-dashoffset: 280;
              stroke-width: 5px;
              transform-origin: 50% 50%;
            }


            @keyframes circle-animation {
              0%,
              25% {
                stroke-dashoffset: 280;
                transform: rotate(0);
              }
              
              50%,
              75% {
                stroke-dashoffset: 75;
                transform: rotate(45deg);
              }
              
              100% {
                stroke-dashoffset: 280;
                transform: rotate(360deg);
              }
            }

            /* high contrast mode */
            @@media screen and (-ms-high-contrast: active) {
                div#LoadingModal img {
                display: none;
                }
            }</style><style id="ssrStyle"></style><script>/*! For license information please see microsoft.office.smartlookup.bootstrap.js.LICENSE.txt */
